			{
				people.map((person, i) => {
				return (
				<Card 
				key={i} 
				id={people[i].name} 
				name={robots[i].homeworld} 
				email={robots[i].height}
				/> 
				) 
				})

			}		
		</div>
	)
}





export default CardList;
